  all: unset;
  color: inherit;
  cursor: pointer;
}

#portal{
  position: fixed;
  top: 0;
  left: 0;
  bottom: 0;
  right: 0;
  z-index: 1000;
  pointer-events: none;

  .upSmallPopup{
    position: absolute;
    top: 7rem;
    left: 50%;
    transform-origin: center;
    transform: translateX(-50%);
    padding: .3rem .5rem;
    border-radius: .25rem;
    color: $white;
    background-color: rgba($validColor, .8);
    &.warning{
      background-color: rgba($warningColor, .8);
    }
    &.danger{
      background-color: rgba($dangerColor, .8);
    }
